// SPDX-License-Identifier: MIT

pragma solidity>=0.5.0<0.9.0;

contract Crowd
{
    mapping(address=>uint) public contributers;      //getting information of contributers
    address public manager;
    uint public minContribution;
    uint public deadline;
    uint public targate ;
    uint public raisedAmt;
    uint public noOfContributers;

    //  ---------------------------  Creating Struct for request for Funding to transfer money-------------------------------

    struct Request{          // its for request to transfer to manager

    string description;           //why money transfer to manager acc
    address payable reciepent;     // who recive the money from manager 
    uint value;                    // ammount
    bool completed;      
    uint noOfVoters;                // how many voters
    mapping(address=>bool) votters ;    // consiste votters address 
     
 }
  //-------------------------------------------------------------------------------------------------------------------------------
    mapping(uint=>Request) public request;      //its for how many request are there for funding..
    uint public numRequest;


//-----constructor for manager,set targets ,deadline --------------
    constructor(uint targ ,uint deadLine){

        targate=targ*1000000000000000000;
        deadline = block.timestamp+deadLine;       // addding time in seconds.
        manager =msg.sender;
        minContribution = 2 ether;                //minimum contribution is set 


    }


//--------- senEthe function for contributers to  sending ether/wei  -----------

    function senEthe() public payable{
        require(block.timestamp < deadline ,"deadline is passed");
        require(msg.value>= minContribution ," Minimum contribution is 2 ether and your conntrubution not met");

        if(contributers[msg.sender]==0)   // cheack the first time contributer  or repeate contributor
        {
            noOfContributers++;
        }

        contributers[msg.sender] += msg.value;   // increse only the value or ammount 
        raisedAmt+=msg.value;                  // increase the amount in raisedAmt 
    }
         

  //-------------Create function for cheak a balance----------------  

     function getBalance() public view returns(uint){
            return address(this).balance;                       // getting total balance 
     }    

//   -------------------create Refund Function------------
     function refund() public payable{

         require(block.timestamp>deadline,"you are not eligible for refund");   // cheak the deadline is crossed
         require(contributers[msg.sender]>0);                                  // cheak the contributer contribute or not 
          
         address payable user = payable (msg.sender);              // we can transfer the money in this account

         user.transfer(contributers[msg.sender]);              // we can refund the amount which is contributed
         contributers[msg.sender]=0;                          // and set the 0 

     }

     // --------------create modifier------

     modifier onlyManager(){                                                          // modifire is used to change the behavier of function .
         require(msg.sender == manager,"Only manager can call this function");         // cheak the manager address      
         _;
     }
 
    // -----------------Request For Fund-------------------
     function createRequest(string memory _discription ,address payable _reciepent ) public  onlyManager
     {
        Request storage newRequest = request[numRequest];                              // new request stored.
        numRequest++;    

        newRequest.description=_discription;
        newRequest.reciepent=_reciepent;
        newRequest.value=targate;
        newRequest.completed=false;
        newRequest.noOfVoters=0;

     }


     //-----------------------------voting function----------

     function voteReq(uint requestNo)public
     {
        require(contributers[msg.sender]>0,"You must be contributer");
        Request storage thisRequest = request[requestNo];
        require(thisRequest.votters[msg.sender]==false,"you alrady votted");               // cheak votted or not
        thisRequest.votters[msg.sender]=true; 
        thisRequest.noOfVoters++;
        
     } 

//   ---------------------Payment Function -------------------------------
     function makePayment(uint requestNo)public onlyManager{

         require(raisedAmt>=targate);
         Request storage thisRequest = request[requestNo];
         require(thisRequest.completed==false,"The request has been completed.");       // cheak request is already complited or not if not then move to next line
         require(thisRequest.noOfVoters > noOfContributers/2,"mejority does not match");   // cheak  Voting is above 50%  then move to next line
         thisRequest.reciepent.transfer(thisRequest.value);                               // transfer the amount in recipent account
         thisRequest.completed=true;                                        // compete the Request .
         

     }

